import React, {useState} from 'react';
import './Logo.css'

const Logo = () => {

    const [open, setOpen] = useState(false);

    let classes = open ? 'logo__title-expanded' : 'logo__title-hidden'

    return (
        <div>
            <h1 className='logo__title' onClick={() => setOpen(!open)}>
                <span className='logo__title-first'>F</span><span className={classes}>ilip</span>
                <span className='logo__title-first'>Z</span><span className={classes}>akrocki</span>
                <span className='logo__title-first'>L</span><span className={classes}>anding</span>
                <span className='logo__title-first'>P</span><span className={classes}>age</span>
            </h1>          
        </div>
    );
}

export default Logo;
